import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import RecipeReviewCard1 from './item1';
import RecipeReviewCard2 from './item2';
import RecipeReviewCard3 from './item3';
import RecipeReviewCard4 from './item4';
import RecipeReviewCard5 from './item5';
import RecipeReviewCard6 from './item6';

function AutoLayoutSizingExample() {
    return (
      <Container className='mt-5'>
        <Row>
          <Col><RecipeReviewCard1 /></Col>
          <Col><RecipeReviewCard2 /></Col>
          <Col><RecipeReviewCard3 /></Col>
        </Row>
        <Row className='mt-5'>
          <Col><RecipeReviewCard4 /></Col>
          <Col><RecipeReviewCard5 /></Col>
          <Col><RecipeReviewCard6 /></Col>
        </Row>
      </Container>
    );
  }
  
  export default AutoLayoutSizingExample;
